CREATE TABLE flights (
    id VARCHAR (255) NOT NULL,
    route VARCHAR(255) NOT NULL,
    distanceKm INTEGER NOT NULL,
    originAirport VARCHAR(255) NOT NULL,
    originCity VARCHAR(255) NOT NULL,
    latitudeOrigin DECIMAL(20,15) NOT NULL,
    longitudeOrigin DECIMAL(20,15) NOT NULL,
    destinationAirport VARCHAR(255) NOT NULL,
    destinationCity VARCHAR(255) NOT NULL,
    latitudeDestination DECIMAL(20,15) NOT NULL,
    longitudeDestination DECIMAL(20,15) NOT NULL,
    dayOfWeek INTEGER NOT NULL,
    departureTime TIME NOT NULL,
    arrivalTime TIME NOT NULL,
    flightSize INTEGER NOT NULL,
    PRIMARY KEY(id)
);

